{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Inbound packets discarded','net.if.in.discards[ifInDiscards.{#SNMPINDEX}]','300','1w','365d',0,3,'','','',0,'','','','',0,'',27099,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe number of inbound packets which were chosen to be discarded\r\neven though no errors had been detected to prevent their being deliverable to a higher-layer protocol.\r\nOne possible reason for discarding such a packet could be to free up buffer space.\r\nDiscontinuities in the value of this counter can occur at re-initialization of the management system,\r\nand at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(27323,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.14.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Inbound packets with errors','net.if.in.errors[ifInErrors.{#SNMPINDEX}]','300','1w','365d',0,3,'','','',0,'','','','',0,'',27106,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nFor packet-oriented interfaces, the number of inbound packets that contained errors preventing them from being deliverable to a higher-layer protocol.  For character-oriented or fixed-length interfaces, the number of inbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(27324,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.6.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Bits received','net.if.in[ifHCInOctets.{#SNMPINDEX}]','180','30d','365d',0,3,'','bps','',0,'','','','',0,'',27104,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe total number of octets received on the interface,including framing characters.  This object is a 64-bit version of ifInOctets. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(27325,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.19.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Outbound packets discarded','net.if.out.discards[ifOutDiscards.{#SNMPINDEX}]','300','1w','365d',0,3,'','','',0,'','','','',0,'',27102,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe number of outbound packets which were chosen to be discarded\r\neven though no errors had been detected to prevent their being deliverable to a higher-layer protocol.\r\nOne possible reason for discarding such a packet could be to free up buffer space.\r\nDiscontinuities in the value of this counter can occur at re-initialization of the management system,\r\nand at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(27326,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.20.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Outbound packets with errors','net.if.out.errors[ifOutErrors.{#SNMPINDEX}]','300','1w','365d',0,3,'','','',0,'','','','',0,'',27103,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nFor packet-oriented interfaces, the number of outbound packets that contained errors preventing them from being deliverable to a higher-layer protocol.  For character-oriented or fixed-length interfaces, the number of outbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(27327,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.10.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Bits sent','net.if.out[ifHCOutOctets.{#SNMPINDEX}]','180','30d','365d',0,3,'','bps','',0,'','','','',0,'',27105,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe total number of octets transmitted out of the interface, including framing characters.  This object is a 64-bit version of ifOutOctets.Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(27328,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.15.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Speed','net.if.speed[ifHighSpeed.{#SNMPINDEX}]','300','1w','0d',0,3,'','bps','',0,'','','','',0,'',27101,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nAn estimate of the interface\'s current bandwidth in units of 1,000,000 bits per second.  If this object reports a value of `n\' then the speed of the interface is somewhere in the range of `n-500,000\' to`n+499,999\'.  For interfaces which do not vary in bandwidth or for those where no accurate estimation can be made, this object should contain the nominal bandwidth.  For a sub-layer which has no concept of bandwidth, this object should be zero.',0,'30d',0,0,0,'',0,'',NULL),(27329,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.8.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Operational status','net.if.status[ifOperStatus.{#SNMPINDEX}]','60','14d','0d',0,3,'','','',0,'','','','',0,'',27107,20,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe current operational state of the interface.\r\n- The testing(3) state indicates that no operational packet scan be passed\r\n- If ifAdminStatus is down(2) then ifOperStatus should be down(2)\r\n- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic\r\n- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)\r\n- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,0,'',0,'',NULL),(27330,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.3.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Interface type','net.if.type[ifType.{#SNMPINDEX}]','3600','1w','0d',0,3,'','','',0,'','','','',0,'',27100,21,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe type of interface.\r\nAdditional values for ifType are assigned by the Internet Assigned NumbersAuthority (IANA),\r\nthrough updating the syntax of the IANAifType textual convention.',0,'30d',0,0,0,'',0,'',NULL),(27331,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.2.1.10.7.2.1.19,{#IFOPERSTATUS},1.3.6.1.2.1.2.2.1.8,{#IFALIAS},1.3.6.1.2.1.31.1.1.1.18,{#IFNAME},1.3.6.1.2.1.31.1.1.1.1,{#IFDESCR},1.3.6.1.2.1.2.2.1.2]',10218,'EtherLike-MIB Discovery','net.if.duplex.discovery','3600','90d','0',0,4,'','','',0,'','','','',0,'',27031,NULL,'','',0,'','','','',0,1,NULL,'','Discovering interfaces from IF-MIB and EtherLike-MIB. Interfaces with up(1) Operational Status are discovered.',0,'30d',0,0,0,'',1,'',NULL),(27332,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.10.7.2.1.19.{#SNMPINDEX}',10218,'Interface {#IFNAME}({#IFALIAS}): Duplex status','net.if.duplex[dot3StatsDuplexStatus.{#SNMPINDEX}]','300','1w','0d',0,3,'','','',0,'','','','',0,'',27032,19,'','',0,'','','','',0,2,NULL,'','MIB: EtherLike-MIB\r\nThe current mode of operation of the MAC\r\nentity.  \'unknown\' indicates that the current\r\nduplex mode could not be determined.\r\n\r\nManagement control of the duplex mode is\r\naccomplished through the MAU MIB.  When\r\nan interface does not support autonegotiation,\r\nor when autonegotiation is not enabled, the\r\nduplex mode is controlled using\r\nifMauDefaultType.  When autonegotiation is\r\nsupported and enabled, duplex mode is controlled\r\nusing ifMauAutoNegAdvertisedBits.  In either\r\ncase, the currently operating duplex mode is\r\nreflected both in this object and in ifMauType.\r\n\r\nNote that this object provides redundant\r\ninformation with ifMauType.  Normally, redundant\r\nobjects are discouraged.  However, in this\r\ninstance, it allows a management application to\r\ndetermine the duplex status of an interface\r\nwithout having to know every possible value of\r\nifMauType.  This was felt to be sufficiently\r\nvaluable to justify the redundancy.\r\nReference: [IEEE 802.3 Std.], 30.3.1.1.32,aDuplexStatus.',0,'30d',0,0,0,'',0,'',NULL),(27333,3,'','',10218,'ICMP ping','icmpping','60','1w','365d',0,3,'','','',0,'','','','',0,'',27149,1,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27334,3,'','',10218,'ICMP loss','icmppingloss','60','1w','365d',0,0,'','%','',0,'','','','',0,'',27150,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27335,3,'','',10218,'ICMP response time','icmppingsec','60','1w','365d',0,0,'','s','',0,'','','','',0,'',27151,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27336,17,'','',10218,'SNMP traps (fallback)','snmptrap.fallback','300','14d','0',0,2,'','','',0,'','','','',0,'hh:mm:sszyyyy/MM/dd',27157,NULL,'','',0,'','','','',0,0,NULL,'','Item is used to collect all SNMP traps unmatched by other snmptrap items',0,'30d',0,0,0,'',0,'',NULL),(27337,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.4.0',10218,'Device contact details','system.contact','3600','14d','0',0,1,'','','',0,'','','','',0,'',27156,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe textual identification of the contact person for this managed node, together with information on how to contact this person.  If no contact information is known, the value is the zero-length string.',23,'30d',0,0,0,'',0,'',NULL),(27338,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.1.0',10218,'Device description','system.descr','3600','14d','0',0,1,'','','',0,'','','','',0,'',27153,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nA textual description of the entity.  This value should\r\ninclude the full name and version id