and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,0,'',0,'',NULL),(27605,1,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.3.{#SNMPINDEX}',10225,'Interface {#IFDESCR}: Interface type','net.if.type[ifType.{#SNMPINDEX}]','3600','1w','0d',0,3,'','','',0,'','','','',0,'',27070,21,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe type of interface.  \r\nAdditional values for ifType are assigned by the Internet Assigned NumbersAuthority (IANA),\r\nthrough updating the syntax of the IANAifType textual convention.',0,'30d',0,0,0,'',0,'',NULL),(27606,1,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.2.1.10.7.2.1.19,{#IFOPERSTATUS},1.3.6.1.2.1.2.2.1.8,{#IFALIAS},1.3.6.1.2.1.31.1.1.1.18,{#IFNAME},1.3.6.1.2.1.31.1.1.1.1,{#IFDESCR},1.3.6.1.2.1.2.2.1.2]',10225,'EtherLike-MIB Discovery','net.if.duplex.discovery','3600','90d','0',0,4,'','','',0,'','','','',0,'',27029,NULL,'','',0,'','','','',0,1,NULL,'','Discovering interfaces from IF-MIB and EtherLike-MIB. Interfaces with up(1) Operational Status are discovered.',0,'30d',0,0,0,'',1,'',NULL),(27607,1,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.10.7.2.1.19.{#SNMPINDEX}',10225,'Interface {#IFNAME}({#IFALIAS}): Duplex status','net.if.duplex[dot3StatsDuplexStatus.{#SNMPINDEX}]','300','1w','0d',0,3,'','','',0,'','','','',0,'',27030,19,'','',0,'','','','',0,2,NULL,'','MIB: EtherLike-MIB\r\nThe current mode of operation of the MAC\r\nentity.  \'unknown\' indicates that the current\r\nduplex mode could not be determined.\r\n\r\nManagement control of the duplex mode is\r\naccomplished through the MAU MIB.  When\r\nan interface does not support autonegotiation,\r\nor when autonegotiation is not enabled, the\r\nduplex mode is controlled using\r\nifMauDefaultType.  When autonegotiation is\r\nsupported and enabled, duplex mode is controlled\r\nusing ifMauAutoNegAdvertisedBits.  In either\r\ncase, the currently operating duplex mode is\r\nreflected both in this object and in ifMauType.\r\n\r\nNote that this object provides redundant\r\ninformation with ifMauType.  Normally, redundant\r\nobjects are discouraged.  However, in this\r\ninstance, it allows a management application to\r\ndetermine the duplex status of an interface\r\nwithout having to know every possible value of\r\nifMauType.  This was felt to be sufficiently\r\nvaluable to justify the redundancy.\r\nReference: [IEEE 802.3 Std.], 30.3.1.1.32,aDuplexStatus.',0,'30d',0,0,0,'',0,'',NULL),(27608,3,'','',10225,'ICMP ping','icmpping','60','1w','365d',0,3,'','','',0,'','','','',0,'',27138,1,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27609,3,'','',10225,'ICMP loss','icmppingloss','60','1w','365d',0,0,'','%','',0,'','','','',0,'',27139,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27610,3,'','',10225,'ICMP response time','icmppingsec','60','1w','365d',0,0,'','s','',0,'','','','',0,'',27140,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27611,17,'','',10225,'SNMP traps (fallback)','snmptrap.fallback','300','14d','0',0,2,'','','',0,'','','','',0,'hh:mm:sszyyyy/MM/dd',27146,NULL,'','',0,'','','','',0,0,NULL,'','Item is used to collect all SNMP traps unmatched by other snmptrap items',0,'30d',0,0,0,'',0,'',NULL),(27612,1,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.4.0',10225,'Device contact details','system.contact','3600','14d','0',0,1,'','','',0,'','','','',0,'',27145,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe textual identification of the contact person for this managed node, together with information on how to contact this person.  If no contact information is known, the value is the zero-length string.',23,'30d',0,0,0,'',0,'',NULL),(27613,1,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.1.0',10225,'Device description','system.descr','3600','14d','0',0,1,'','','',0,'','','','',0,'',27142,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nA textual desc