ge on the entity, and it\r\nis not sensible with the number of CPU on the entity',0,'30d',0,0,0,'',0,'',NULL),(27672,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.25506.2.6.1.1.1.1.12.{#SNMPINDEX}',10227,'{#SNMPVALUE}: Temperature','sensor.temp.value[hh3cEntityExtTemperature.{#SNMPINDEX}]','180','30d','365d',0,0,'','C','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: HH3C-ENTITY-EXT-MIB\r\nThe temperature for the {#SNMPVALUE}.',0,'30d',0,0,0,'',0,'',NULL),(27673,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.25506.2.6.1.1.1.1.19.{#SNMPINDEX}',10227,'{#ENT_NAME}: Fan status','sensor.fan.status[hh3cEntityExtErrorStatus.{#SNMPINDEX}]','180','14d','0d',0,3,'','','',0,'','','','',0,'',NULL,39,'','',0,'','','','',0,2,NULL,'','MIB: HH3C-ENTITY-EXT-MIB\r\nIndicate the error state of this entity object.\r\nfanError(41) means that the fan stops working.',0,'30d',0,0,0,'',0,'',NULL),(27674,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.25506.2.6.1.1.1.1.19.{#SNMPINDEX}',10227,'{#ENT_NAME}: Power supply status','sensor.psu.status[hh3cEntityExtErrorStatus.{#SNMPINDEX}]','180','14d','0d',0,3,'','','',0,'','','','',0,'',NULL,39,'','',0,'','','','',0,2,NULL,'','MIB: HH3C-ENTITY-EXT-MIB\r\nIndicate the error state of this entity object.\r\npsuError(51) means that the Power Supply Unit is in the state of fault.\r\nrpsError(61) means the Redundant Power Supply is in the state of fault.',0,'30d',0,0,0,'',0,'',NULL),(27675,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.47.1.1.1.1.10.{#SNMPINDEX}',10227,'{#ENT_NAME}: Operating system','system.sw.os[entPhysicalSoftwareRev.{#SNMPINDEX}]','3600','14d','0',0,1,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: ENTITY-MIB',0,'30d',0,0,0,'',0,'',NULL),(27676,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.47.1.1.1.1.8.{#SNMPINDEX}',10227,'{#ENT_NAME}: Hardware version(revision)','system.hw.version[entPhysicalHardwareRev.{#SNMPINDEX}]','3600','14d','0',0,1,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: ENTITY-MIB',0,'30d',0,0,0,'